import { NavBarStyle, LinkStyle, IconImage, ErrorDiv, ErrorLink } from "../styled-components/NavbarStyle"

import React from 'react'
import {connect} from 'react-redux'
import { user, visit } from "./NavbarFlip";
import NavLinks from "./NavLinks";
function NavbarInfo() {

	const checkToken = localStorage.getItem("jsonwebtoken");


	return (
		<NavBarStyle>
			{checkToken
			? user.map((navlinks) => <NavLinks navlinks={navlinks}/>)
			: visit.map((navlinks)=> <NavLinks navlinks={navlinks}/>)
			}
			</NavBarStyle>
	)
}


const mapStateToProps = (state) => {
	return {
		isLoggedIn: state.isLoggedIn
	}
}

export default connect(mapStateToProps)(NavbarInfo)
